class Solution {
    public int maxOperations(String s) {
        char[] chars = s.toCharArray();
        int cnt = 0;
        int oneCnt=0;
        for(int i=0;i<s.length()-1;i++){
            if(chars[i]=='1'){
                oneCnt++;
            }
            if(chars[i]=='1' && chars[i+1]=='0'){
                cnt+=oneCnt;
            }
        }
        return cnt;
    }
}
